There are various ways we might handle 'energy-related' parameters.  The amount of energy might be handled as an x-schema resource and/or input.  The source of energy could be another role in this frame (energy-source), which would be bound to the actor for self-propelled motion, and to an external Causer in the case of CausedMotion.

{{Frame
|Description=This is the most general Motion frame.  

Frame description: All or part of an entity (mover) moves with respect to some landmark or background. This general frame encompasses both "motion-in-place" (movement that can occur within a fixed location, e.g. spinning) and translational motion (in which the mover occupies a series of different locations over time -- see Motion_Along_A_Path).  This frame could also be used to specify lack of motion (i.e. speed = 0).
