|Inferences={{Inference
|Inference.Description=at x-schema.initial, possessor does not possess object.  At x-schema.start_transtion, possessor acquires object. At x-schema.ongoing, possessor possesses object.
At x-schema.finish_transtion, possessor loses possession of object. 
At x-schema.final, possessor does not possess object.
}}
|Relevant LUs=
}}
Lexical units tend to focus either on change from non-possession to possession (e.g. get, acquire) or on change from possession to non-possession (e.g. lose).  The initial-start-ongoing portion of the x-schema for the current frame captures the first type of change, and the ongoing-finish-final portion of the x-schema captures the second type of change.

